import './App.css';

function App() {
  const name = <h1>My name is Jamie!</h1>
  const age =<h2>24</h2>
  const email = <h2>jamie@gmail.com</h2>
  const user = (
    <div>
      {name}
      {age}
      {email}
    </div>
  );
  return (
    <div className="App">
      {user}
    </div>
  );
}

export default App;
